//key attribute is the only attribute that can pass React.Fragment
import React from 'react'
function Columns(){
    const items = []  
    return(
        <React.Fragment>
            {
                items.map((items)=>{
                    <React.Fragment key = {items.id}>
                     <h1>Title</h1>
                     <p>{items.title}</p>
                    </React.Fragment>
                })
            }
         <td>Name</td>
         <td>karthik yadav</td>
         </React.Fragment>
    )
}
export default Columns
